    false,nt"url": null,nt"notes": "For the purposes of this analysis, Wildland
    Urban Interface is mapped using 2000 Census data and the communities listed in Idaho
    as "at risk" in the 2001 Federal Register (Vol. 66, Number 160, August 17, 2001),
    buffered by 1 mile. There were weaknesses with both data sets; data representing
    "urban wildland communities" are commonly not incorporated communities, nor are
    they areas that can be precisely located from a geographic standpoint. The Census
    data accounts for permanent residences only; it does not account for seasonal residences
    (e.g., summer cabins and ski area condominiums), or residences occurring on public
    lands (e.g. leased cabin sites).",nt"owner_org": "75e22a8a-da5f-46f3-93d8-924063a3703d",nt"extras":
